import React from 'react';
import Button from '@material-ui/core/Button';
import NavLink from 'react-router-dom';

const SignedInLinks = () => {

    return(
        <div>
            <Button color="inherit"><Navlink to='/'>New project</Navlink></Button>
            <Button color="inherit"><Navlink to='/'>Log out</Navlink></Button>
        </div>
    )
}

export default SignedInLinks;
